import React from 'react'

export default function Profile() {
  return (
    <div className='profile'>
      <div className='profile-frame'>
        <div className='profile-pic'>
          <img src='https://plus.unsplash.com/premium_photo-1668116307088-583ee0d4aaf7?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHx0b3BpYy1mZWVkfDIzfGJvOGpRS1RhRTBZfHxlbnwwfHx8fHw%3D&auto=format&fit=crop&w=500&q=60'/>
        </div>
      </div>
    </div>
  )
}
